import React, {useEffect, useState} from "react";

class Example extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        wartosc: <b> xddd </b>
      };
    }
  
    render() {
      return (
        <div>
          <p> test {this.state.wartosc} razy</p>
          </div>
      );
    }
  }
  export default Example
